import styles from "./Header.module.scss";
import {motion} from "framer-motion";

const Header = () => {
    return <div className={styles.main}>
        <h1 className={styles.hello}>hello</h1>
        <motion.h1>we</motion.h1>
    </div>
}

export default Header;
